import logo from './logo.svg';
import './App.css';


function varFunction(){
  var a = "hello";
  if(true){
    var a ="bye";
    console.log(a);
  }
  console.log(a);
}
varFunction();

function constFunction(){
  const a = "bye";
  if(true){
    const a = "hello";
    console.log(a);
  }
  console.log(a);
}
constFunction();

const name = '리액트 테스트';

function App() {

  return (
    <>
    {name === '리액트 테스트' ? (<h1>name 값이 리액트 테스트임다.</h1>) 
                          : (<h1>리액트 테스트가 아님다.</h1>) };
    </>
  );
}

export default App;
